"<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'SimSun\'; font-size:12pt; font-weight:600;\"><br /></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'SimSun\'; font-size:12pt; font-weight:600;\">    该软件具备从原始脑电波形中提取与心理健康相关生物标志物的能力，实现使用者神经心理状态的量化评估。系统支持长达24小时的三通道脑电连续监测与数据分析，适用于用户神经心理状态的长期追踪与数据记录。此功能便于研究者或临床专业人员随时调阅不同时间段的脑电数据，分析精神状态的动态变化趋势，从而为心理健康领域的深入研究、临床诊断与管理决策提供客观、准确的神经生理学数据支持。</span></p>\n"
